import React from "react";
import logo from "./logo.svg";
import "./App.css";
import ListItem from "./ListItem/ListItem.js";
const titles = ["Title 1", "Title 2"];

// const listItems = [
//   <ListItem title={titles[0]} />,
//   <ListItem title={titles[1]} />
// ];

const listItems = titles.map( item => <ListItem key={1} title = {item}/>);

function App() {
  return (
    <div className="App">
      {/* {[
        <ListItem title={titles[0]} />,
        <ListItem title={titles[1]} />
      ]} */}
      {listItems}
    </div>
  );
}

export default App;



